import './App.css';

import  Home from './components/Home';
import  About from './components/About';
import Navebar from './components/Navebar';


function App() {
  return (
    <>
    <BrowserRouter>
    <Navebar />
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/About" element={<About />} />
    </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
